export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},BFUAaF94ZX:{data:{id:1447,attributes:{imdbId:"tt0089283",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNGE3NGIwN2QtZTg0Ni00YWU4LTliNWUtZmVmMmRkNWU3MTAwXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"33%"}],item_lang:{data:{id:2110,attributes:{title:a,plot:"Noel Holcroft is a foreign-born American citizen working in New York City as an architect. In Geneva, he meets with a respected Swiss banker who tells him he has been designated to be executor of a huge four and a half billion dollar trust fund designed to make reparations for the war crimes of the Nazis. Holcroft's father, who committed suicide in 1945, was a key Hitler financial advisor, who became conscience-stricken about German war atrocities, turned against the Führer, and covertly diverted Nazi funds to a secret Swiss account. Under the terms of the covenant, Holcroft must locate the sons of his father's two associates so they can jointly activate their fathers' account. They battle the sinister forces seem to be trying to prevent them from signing the document, as it is believed that it will be used to establish a Fourth Reich.",slug:"the-holcroft-covenant"}}},books:{data:[{id:7703,attributes:{title:a,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:f,subtitle:l}},{id:7704,attributes:{title:a,description:"The Fourth Reich is waiting to be born. The only man who can stop it is about to sign its birth certificate. In 1945 the children of the Third Reich were secretly hidden all over the world-to be concealed until the 1970's, when they would come of age. Then the most elaborate plans and $780 million in a Swiss bank would be waiting. There would even be an unsuspecting outsider to set the plan into action. that outsider is Noel Holcroft, the American son of a high-ranking Nazi. He's just been shown an amazing document, the Holcroft Covenant. If he signs, it will be his own death warrant and a devastating threat to the security of the world. Copyright © Libri GmbH. All rights reserved.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Jen8xNppr60C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"1984-05-01",publisher:f,subtitle:c}},{id:7705,attributes:{title:a,description:i,thumbnail:j,authors:[b],firstBook:e,published:k,publisher:f,subtitle:l}},{id:7706,attributes:{title:"Three Complete Novels",description:"A collection of novels by the best-selling master of political intrigue features The Holcroft Covenant, The Matarese Circle, and The Bourne Identity.",thumbnail:c,authors:[b],firstBook:e,published:"1993-12-01",publisher:"Outlet",subtitle:"The Holcroft Covenant: The Matarese Circle; The Bourne Identity"}},{id:7707,attributes:{title:a,description:c,thumbnail:c,authors:[b],firstBook:e,published:"1993-01-01",publisher:c,subtitle:"The Rhinemann Exchange"}}]}}},meta:{}}},prerenderedAt:1682568486112}}("The Holcroft Covenant","Robert Ludlum","","movie",null,"Bantam","series",1,"The Fourth Reich is waiting to arise—and the only man who can stop it is about to sign its birth certificate. In 1945 the children of the Third Reich were secretly hidden all over the world, to be concealed until they came of age in the 1970s, at which point $780 million would be waiting in a Swiss bank. But all of these elaborate plans need an unsuspecting outsider to set them in motion: Noel Holcroft, the American son of a high-ranking Nazi officer. He has just been shown an incredible document known as the Holcroft Covenant. If he signs, he will inadvertently deal a serious blow to an already fragile world—and authorize his own death warrant. Praise for Robert Ludlum and The Holcroft Covenant “Pleases and seduces . . . [Robert] Ludlum stuffs more surprises into his novels than any other six-pack of thriller writers combined. . . . I sprained my wrist turning his pages and didn’t notice until an hour later.”—John Leonard, The New York Times “Don’t ever begin a Ludlum novel if you have to go to work the next day.”—Chicago Tribune BONUS: This edition includes an excerpt from Robert Ludlum’s The Bourne Identity.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KMnLqLl517sC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2012-08-14","A Novel"))